Nomen dubium, u zoološkoj nomenklaturi, je (latinska oznaka za upitno ime") je znanstveno ime koje je nepoznate ili upitne primjene (nomina dubia).
U bakteriološkoj nomenklaturi, nomina dubia mogu se staviti na popis odbijenih imena Pravosudne komisije. Značenje tih imena je neizvjesno. Ostale kategorije imena koja se mogu tretirati na ovaj način (pravilo 56a) su:

nejasna imena, nomina ambigua, sa više od jednog značenja;
zbunjujuća imena, nomina confusa, temelje se na mješovitoj kulturi;
Zbunjujući imena   'nomina perplexa'  , zbunjujuće slična imena;
Pogibeljna imena, nomina periculosa, imena koja mogu dovesti do nezgoda koje dovode u opasnost život ili zdravlje ili s mogućim ozbiljnim privrednim posljedicama.
U botaničkoj nomenklaturi fraza nomen dubium nema zvanični status, iako se neformalno koristi za imena čija primjena postaje zbunjujuća. U tom smislu, međutim, koristi se češće sinonim nomen ambiguum. U botanici, takvi nazivi mogu biti predloženi za odbacivanje.
